					data.push(trace)
				}
				trace.x.push(raw[i][0])
				trace.y.push(raw[i][4])
			}
			Plotly.newPlot('myPlotDiv3', data);
		}
	</script>
	<button onclick="renderButton()">Plot</button><br>
	<div id="myPlotDiv" style="width: 100%; height: 500px;"><br>
  </body>
